import { Button, FormControl, InputLabel, OutlinedInput } from "@mui/material";
import React from "react";
import { useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { login } from "../../storage/auth.service";
import { setUserData } from "../../store/auth.storage";

const LoginForm = () => {
    const dispatch = useDispatch();
    const navigate = useNavigate();
    const [error, setError] = React.useState(null);

    const onLoginSubmit = (event: React.FormEvent<HTMLFormElement>) => {
        event.preventDefault();

        const email = event.currentTarget.username.value;
        const password = event.currentTarget.password.value;

        login(email, password).then((res) => {
            setUserData(res.accessToken, res.refreshToken, dispatch);
            setError(null);
            // ..navigate
        }).catch((e) => {
            console.log(e);
            // ..error
        })
    };

  return (
    <form onSubmit={onLoginSubmit}>
      <FormControl>
        <InputLabel htmlFor="username">Username</InputLabel>
        <OutlinedInput
          id="username"
          aria-describedby="username"
          required
          placeholder="Username"
          label="Username"
        />
      </FormControl>
      <FormControl>
        <InputLabel htmlFor="password">Password</InputLabel>
        <OutlinedInput
          id="password"
          aria-describedby="password"
          required
          placeholder="Password"
          label="Password"
          type="password"
        />
      </FormControl>
      <Button type="submit">
        Submit
      </Button>
    </form>
  );
};

export default LoginForm;
